    <div className='Header'>
      <div className='container-icon'>

      </div>
      <div className='container-auth'></div>
      <div className = 'container-add-template'>
      <Button as={Link}  to="/addPosts" variant="outline-secondary" className = 'button-add-temolate '>Додати оголошення</Button>
      </div>
    </div>
  );
}

export default Header;
